    "$oid": "5bd0fdfebc54ef73c6b2c841"
},
"name": "Joe",
"email": "joe@test.com",
"password": "$2a$10$6piR5uuLqZxEXbazwHBw7egFYJwnwEs3AYdpJGvlW1/cu6CGj1f8a",
