Distinct with only matching subdocuments<p>Lets say I have some documents that looks like:</p>

<pre><code>{
    "stuff": [
        {"thing": "A", "data": "helloworld"},
        {"thing": "A", "data": "something"},
        {"thing": "B", "data": "foobar"}
    ]
},
{
    "stuff": [
        {"thing": "A", "data": "something else"},
        {"thing": "B", "data": "foobar"}
    ]
}
</code></pre>

<p>How can I get the list of distinct <code>data</code> where <code>thing = A</code> <em>only</em>.</p>

<p>I know how I can <code>find</code> these subdocuments with:</p>

<pre><code>db.col.find({"stuff.thing": "A"}, {"stuff.$":1})
</code></pre>

<p>But I can't find any info on doing a <code>distinct</code> query on the matching subdocuments only.</p>

