How can I store data in mongodb using nodejs / express?<p>I have created chat application using socket.io and I am storing array of messages. Each array object has <code>message</code> and <code>date</code>. The chat app is working only on client side i.e when I refresh the page all previous chats are gone. How can I store the messages programmatically ? using mongodb, nodejs/express and reactjs on client side ? </p>

<p>Code:</p>

<p>server.js:</p>

<pre><code>const express = require('express');
const mongoose = require('mongoose');
const socket = require('socket.io');

const app = express();

const db = require('./config/keys').mongoURI;

mongoose.connect(db, {useNewUrlParser: true})
  .then(() =&gt; console.log('Mongodb connected...'))
  .catch( err =&gt; console.log(err));

const port = 5000;

let server = app.listen(5000, function(){
  console.log('server is running on port 5000')
});

let io =  socket(server);

io.on("connection", function(socket){
  console.log("Socket Connection Established with ID :"+ socket.id)

      socket.on('SEND_MESSAGE', data =&gt; {
        io.emit('RECEIVE_MESSAGE', data);
      });

})
</code></pre>

<p>messageSchema.js:</p>

<pre><code>const mongoose = require('mongoose');
const Schema = mongoose.Schema;

// Create Schema
const MessageSchema = new Schema({
  message: {
    type: String,
    required: true
  },
  date: {
    type: Date,
    default: Date.now
  }
});

module.exports = Message = mongoose.model('Message', MessageSchema);
</code></pre>

<p>chat.js:</p>

<pre><code>import React, { Component } from 'react'
import './chat.css'
import io from "socket.io-client";

export default class Chat extends Component {

    constructor(props){
        super(props);

        this.state = {
            message: '',
            date: '',
            messages: []
        };

        const socket = io('localhost:5000');

        this.sendMessage = event =&gt; {
            event.preventDefault();

            if(this.state.message !== ''){
                socket.emit('SEND_MESSAGE', {
                    message: this.state.message,
                    date: Date.now()
                });
                this.setState({ message: '', date: '' });
            }
        };

        socket.on('RECEIVE_MESSAGE', data =&gt; {
            addMessage(data);
        });

        const addMessage = data =&gt; {
            console.log(data);
            this.setState({
              messages: [...this.state.messages, data],
            });
            console.log(this.state.message);
            console.log(this.state.messages);
        };

    }

    render() {
        return (
        &lt;div&gt;
                &lt;div id="status"&gt;&lt;/div&gt;
                &lt;div id="chat"&gt;
                    &lt;div className="card"&gt;
                        &lt;div id="messages" className="card-block"&gt;
                            {this.state.messages.map((message, index) =&gt; {
                                    return (
                                        &lt;div key={index} className="msgBox"&gt;&lt;p className="msgText"&gt;{message.message}&lt;/p&gt;&lt;/div&gt;
                                    )
                            })}
                        &lt;/div&gt;
                    &lt;/div&gt;
                    &lt;div className="row"&gt;
                        &lt;div className="column"&gt;
                            &lt;input id="inputmsg" type="text" placeholder="Enter Message...."
                            value={this.state.message} onChange={ev =&gt; this.setState({message: ev.target.value})}/&gt;
                        &lt;/div&gt;
                        &lt;div className="column2"&gt;
                            &lt;button id="send" className="button" onClick={this.sendMessage}&gt;Send&lt;/button&gt;
                        &lt;/div&gt;
                    &lt;/div&gt;
                &lt;/div&gt;
        &lt;/div&gt;
        )
    }
}
</code></pre>

<p>Screenshot:</p>

<p><a href="https://i.stack.imgur.com/nE5OZ.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/nE5OZ.png" alt="enter image description here"></a></p>

<p>What modifications should I make in server.js and chat.js so that the chat messages get stored in mongodb database. Do I need to create API endpoint for storing and retrieving previous chats ? Note: I have setup mongodb in mlab with database name <code>mongochat</code> and collection name = <code>chat</code>.</p>

